import React from "react";
import Footer from "../Footer";
import Navbar from "../HomeNoLogin/Navbar";
import Signup from "../Signup";


function SignUpLayout(){


    return(
        <div>
            <Navbar/>
            <Signup/>
            <Footer/>
        </div>
    )
}
export default SignUpLayout;
